import React from "react";
import "./Home.css";
import dairyImage from "../assets/dairy.jpg"; // keep this as per your file name


const Home = () => {
  return (
    <div className="home-container">
      {/* Navbar */}
      <nav className="navbar">
        <div className="logo">Dairy Farm</div>
        <ul className="nav-links">
          <li><a href="/">Home</a></li>
          <li><a href="/login">Login</a></li>
          <li><a href="/register">Register</a></li>
          <li><a href="/buy">Buy Milk</a></li>
          <li><a href="/orders">Orders</a></li>
        </ul>
      </nav>

      {/* Hero Section */}
      <div
        className="hero"
        style={{
          backgroundImage: `url(${dairyImage})`,
        }}
      >
        <div className="overlay">
          <h2>Fresh Dairy Products Delivered to You</h2>
          <p>Healthy. Organic. Straight from the farm to your home.</p>
          <div className="hero-buttons">
            <a href="/buy" className="btn btn-primary">Buy Milk</a>
            <a href="/orders" className="btn btn-secondary">View Orders</a>
          </div>
        </div>
      </div>

      {/* Footer */}
      <footer className="footer">
        <p>Â© 2025 Dairy Farm | Freshness You Can Trust</p>
      </footer>
    </div>
  );
};

export default Home;
